const Collection = () => {
    return (
        <div className="ShopCollection">
            <p className="shopName">SHOP BY COLLECTION</p>

            <div className="cards">
                <div className="menCard"></div>
                <div className="womenCard"></div>
                <div className="summerCard"></div>
                <div className="trendingCard"></div>
            </div>
        </div>
    );
}

export default Collection;
